import React from 'react';
import { PlayerItem } from './PlayerItem';

export const Lists = ({ lists, deleteList, updateList }) => {
  return (
    <div>
      {lists.map(list => (
        <ListItem
          key={list.id}
          id={list.id}
          name={list.todo}
          deleteList={deleteList}
          updateList={updateList}
        />
      ))}
    </div>
  );
};
